import React, { useEffect, useState } from "react";
import { Link } from "react-chrome-extension-router";
import { AppBar, Box, Toolbar, Typography, IconButton, Menu, MenuItem, Divider, ListItemIcon, FormControl, InputLabel, Select } from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";
import AccountCircle from "@mui/icons-material/AccountCircle";
import PersonAdd from '@mui/icons-material/PersonAdd';
import Settings from '@mui/icons-material/Settings';
import Logout from '@mui/icons-material/Logout';
import Content from "../pages/Content";

const Navbar = () => {
	const [auth, setAuth] = React.useState(true);
	const [anchorEl, setAnchorEl] = React.useState(null);

	const [network, setNetwork] = React.useState('');

  const handleNetwork = (event) => {
    setNetwork(event.target.value);
  };

	const handleMenu = (event) => {
		setAnchorEl(event.currentTarget);
	};

	const handleClose = () => {
		setAnchorEl(null);
	};

	return (
		<>
			<Box>
				<AppBar position="static">
					<Toolbar>
					<FormControl variant="standard" sx={{ minWidth: 80 }} size="small">
						<Select
							labelId="select-network"
							id="select-network"
							value={{network}}
							label="Network"
							onChange={handleNetwork}
						>
							<MenuItem value="">
								<em>None</em>
							</MenuItem>
							<MenuItem size="small" value={10}>Ten</MenuItem>
							<MenuItem value={20}>Twenty</MenuItem>
							<MenuItem value={30}>Thirty</MenuItem>
						</Select>
					</FormControl>
						<Typography align="center" variant="h6" component="div" sx={{ flexGrow: 1 }}>
							<Link component={Content}>NEO</Link>
						</Typography>
						{auth && (
							<div>
								<IconButton
									size="large"
									aria-label="account of current user"
									aria-controls="menu-appbar"
									aria-haspopup="true"
									onClick={handleMenu}
									color="inherit">
									<AccountCircle />
								</IconButton>
								<Menu
									id="menu-appbar"
									anchorEl={anchorEl}
									anchorOrigin={{
										vertical: "bottom",
										horizontal: "right",
									}}
									keepMounted
									transformOrigin={{
										vertical: "top",
										horizontal: "right",
									}}
									open={Boolean(anchorEl)}
									onClose={handleClose}
								>
									<MenuItem onClick={handleClose}>Profile</MenuItem>
									<MenuItem onClick={handleClose}>My account</MenuItem>
									<Divider />
									<MenuItem>
										<ListItemIcon>
											<PersonAdd fontSize="small" />
										</ListItemIcon>
										New account
									</MenuItem>
									<MenuItem>
										<ListItemIcon>
											<Settings fontSize="small" />
										</ListItemIcon>
										Setting
									</MenuItem>
									<MenuItem>
										<ListItemIcon>
											<Logout fontSize="small" />
										</ListItemIcon>
										Logout
        					</MenuItem>
								</Menu>
							</div>
						)}
					</Toolbar>
				</AppBar>
			</Box>
		</>
	);
};

export default Navbar;
